import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { welcomeConroller } from "../controllers/welcome-page";

const AdvancedSearch = () => {
  const { categotyId, professionId, searchText } = useParams();
  const [info, setInfo] = useState([]);
  useEffect(() => {
    welcomeConroller.getProfessionByCategory(categotyId).then((response) => {
      let ids = "";
      response.data.map((pr, i) => {
        ids += "provision_fk=" + pr.id + "&";
      });
      welcomeConroller.getInfoByQuery(ids).then((res) => {
        setInfo(res.data);
      });
    });
  }, []);
  useEffect(() => {
    welcomeConroller.getProfession(professionId).then((response) => {
      let query = "";

      if (response.data.length === 1) {
        query = "profession_fk=" + response.data[0].id;
      } else {
        response.data.map((pr, i) => {
          query += "profession_fk=" + pr.id + "&";
        });
      }

      welcomeConroller.getInfoByQuery(query).then((res) => {
        setInfo(res.data);
      });
    });
  }, []);
  console.log(setInfo);
  return <div></div>;
};

export default AdvancedSearch;
